import React from "react";
import { Link } from "react-router-dom";
import SearchBar from "../SearchBar/SearchBar";


const Nav = (props) => {
    return (
      <div>
        <SearchBar onSearch={props.onSearch} />
        <Link to ="/about"><h3>About</h3></Link>
        <Link to ="/home"><h3>Home</h3></Link>
      </div>
    );
  }

export default Nav;
